create table Users
(
    UserID            int auto_increment
        primary key,
    Login             varchar(20)  null,
    Password          varchar(255) null,
    Name              varchar(100) null,
    Phone             varchar(100) null,
    Email             varchar(100) null,
    Country           varchar(100) null,
    City              varchar(100) null,
    UserStatusID      int          null,
    PasportSurName    varchar(255) null,
    PasportName       varchar(255) null,
    PasportMiddleName varchar(255) null,
    PasportSerial     varchar(255) null,
    PasportIssuedBy   varchar(255) null,
    PasportIssuedDate date         null,
    constraint FK_Users_UserStatusID
        foreign key (UserStatusID) references UserStatus (UserStatusID)
)
    collate = utf8_general_ci
    avg_row_length = 5461;

